description:
American Beauty ar filmen alla pratade om. Med sin intelligens,
frackhet och syndiga komik har den en given plats i filmhistorien.
Belonad med 5 Oscar, placerad pa over 275 tio-i-topplistor over
hela varlden och utnamd till arets basta film av over 65 filmkritiker
ar det en film vard att se flera ganger.
